import React from "react";
import '../styles/about.css';

const About = () => {
    return ( 
     <section className="about-us">
        <div className="about-us-container">
            <div className="about-us-box">
                <img src="https://cdn.shopify.com/s/files/1/0306/6419/6141/articles/coding_languages.png?v=1619126283" alt="about-image" className="about-image"/>
               <div className="about-us-knowledge">
                <h1 className="about-us-title">About Peax Studio</h1>
                <p className="about-us-text">we are me are </p>
               </div>

            </div>
        </div>
    </section>
 );
};


export default About;
